import React from "react";
import { Button } from "react-bootstrap";

//presentational component
const Accounts = (props) => {
	console.log(props);

	const handleClickAdmin = (e) => {
		//const { accountId } = e.target;
		//const accountId = props.account.id
		e.persist();
		e.preventDefault();
		props.newDepartment(props.account.account.id, props.history);
	};

	const navigateTo = (id) => () =>
		props.history.push(
			`/accounts/${props.account.account.id}/departments/new`
		);

	return (
		<div class="container">
			<div class="row align-items-center">
				<div class="col">
					{props.accounts
						? props.accounts.map((account) => {
								return (
									<React.Fragment>
										<br></br>
										<br></br>
										<div key={account.id}>
											<label> Account Name - </label>{" "}
											{account.attributes.name}
											<br></br>
										</div>
										<div key={account.id}>
											<label> Balance - </label>{" "}
											{account.attributes.balance}
											<br></br>
										</div>
										<Button onClick={newDepartment}>
											Add Charge
										</Button>
									</React.Fragment>
								);
						  })
						: null}
				</div>
			</div>
		</div>
	);
};

export default withRouter(connect(null, { newDepartment })(Account));
